import React, { useState, useEffect } from "react";
import axios from "axios";
import VerticalGraph from "./VerticalGraph";
import "./Holding.css"; // Ensure you have this file for styling

const Holdings = () => {
  const [allHoldings, setAllHoldings] = useState([]);

  // Fetch stock holdings data from the backend
  useEffect(() => {
    axios
      .get("http://localhost:3002/allHoldings")
      .then((res) => {
        console.log("Fetched Holdings Data:", res.data);
        setAllHoldings(res.data);
      })
      .catch((error) => {
        console.error("Error fetching holdings data:", error);
      });
  }, []);

  // Prepare chart data
  const labels = allHoldings.map((stock) => stock.name);
  const chartData = {
    labels,
    datasets: [
      {
        label: "Stock Price",
        data: allHoldings.map((stock) => Number(stock.price) || 0),
        backgroundColor: "rgba(54, 162, 235, 0.5)",
        borderColor: "rgba(54, 162, 235, 1)",
        borderWidth: 1,
      },
    ],
  };

  return (
    <div className="holdings-container">
      <h3 className="title">Holdings ({allHoldings.length})</h3>

      {/* Table Section */}
      <div className="order-table">
        <table>
          <thead>
            <tr>
              <th>Instrument</th>
              <th>Qty.</th>
              <th>Avg. cost</th>
              <th>LTP</th>
              <th>Cur. val</th>
              <th>P&L</th>
              <th>Net chg.</th>
              <th>Day chg.</th>
            </tr>
          </thead>
          <tbody>
            {allHoldings.map((stock, index) => {
              const qty = Number(stock.qty) || 0;
              const avg = Number(stock.avg) || 0;
              const price = Number(stock.price) || 0;
              const curValue = price * qty;
              const profitLoss = curValue - avg * qty;
              const isProfit = profitLoss >= 0;
              const profClass = isProfit ? "profit" : "loss";

              // Handle percentage values properly
              const netChange = stock.net
                ? parseFloat(stock.net.replace("%", "")) || 0
                : 0;
              const dayChange = stock.day
                ? parseFloat(stock.day.replace("%", "")) || 0
                : 0;

              return (
                <tr key={index}>
                  <td>{stock.name}</td>
                  <td>{qty}</td>
                  <td>{avg.toFixed(2)}</td>
                  <td>{price.toFixed(2)}</td>
                  <td>{curValue.toFixed(2)}</td>
                  <td className={profClass}>{profitLoss.toFixed(2)}</td>
                  <td className={netChange >= 0 ? "profit" : "loss"}>
                    {netChange.toFixed(2)}%
                  </td>
                  <td className={dayChange >= 0 ? "profit" : "loss"}>
                    {dayChange.toFixed(2)}%
                  </td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>

      {/* Stats Section */}
      <div className="row">
        <div className="col">
          <h5>29,875.<span>55</span></h5>
          <p>Total investment</p>
        </div>
        <div className="col">
          <h5>31,428.<span>95</span></h5>
          <p>Current value</p>
        </div>
        <div className="col">
          <h5 className="profit">1,553.40 (+5.20%)</h5>
          <p>P&L</p>
        </div>
      </div>

      {/* Chart Section */}
      <div className="chart-container">
        <VerticalGraph data={chartData} />
      </div>
    </div>
  );
};

export default Holdings;
